<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./index.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto:wght@400;500&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Kameron:wght@400&display=swap"
    />
  </head>
  <body>
    <div class="desktop-2">
      <img
        class="keyboard-return-icon"
        loading="lazy"
        alt=""
        src="./public/keyboard-return.svg"
        id="keyboardReturnIcon"
      />

      <main class="desktop-2-inner">
        <section class="frame-parent">
          <div class="predicted-output-wrapper">
            <div class="predicted-output">Predicted output</div>
          </div>
          <div class="frame-child"></div>
        </section>
      </main>
    </div>

    <script>
      var keyboardReturnIcon = document.getElementById("keyboardReturnIcon");
      if (keyboardReturnIcon) {
        keyboardReturnIcon.addEventListener("click", function (e) {
          window.location.href = "./desktop1.html";
        });
      }
      </script>
  </body>
</html>
